import React from "react";
import "./experience.css";

function experience() {
  return (
    <div className="Experience-wrapper">
      <div className="row">
        <div className="col-md-8">
          <div className="experience-content">
            <h1 className="">Experience</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default experience;
